import { FormContainer, ContentCard } from './style';

const OrderInfoForm = () => {
    return (
        <FormContainer>
            <ContentCard style={{flexDirection:'column', padding:'50px 0'}}>
                <label 
                    style={{
                        fontSize:'1.2rem',
                    }}>
                    주소
                    <input 
                        type="text" 
                        style={{
                            border:'1px solid #4c4a49'
                        }}/>
                </label>
            </ContentCard>
        </FormContainer>
    );
};

export default OrderInfoForm;
